    [],nt"revision_timestamp": "2015-05-07T03:34:33.127871",nt"name": "rf-front-end-based-on-mems-components-for-miniaturized-digital-eva-radio-project",nt"isopen":
    true,nt"url": null,nt"notes": "In this proposal, AlphaSense, Inc. (AI)
    and the Carnegie Mellon University (CMU) detail the development of RF front end
    based on MEMS components for miniaturized digital EVA radio. Key innovations of
    our approach include: a) the use of a novel parallel receiver front end architecture
    based on MEMS components, b) a novel design of a high Q mixer-filter for RF mixing
    and IF filtering, and c) the implementation of band pass filter and voltage controlled
    oscillator (VCO) using CMOS fabrication technique.  Consequently, the proposed EVA
    radio has the following merits: a)Small size, light- weight and low power consumption,
    b)High sensitivity and frequency selectivity, c)Good device reliability, and d)Easy
    device fabrication and low manufacturing cost.",nt"license_title": "U.S. Government
